        employee.push(emp)

        return ( 

            <div>
                <table className="table">
                    <thead>
                        <tr>
                            <th scope="col">Sr</th>
                            <th scope="col">Images</th>
                            <th scope="col">Full Name</th>
                            <th scope="col">DOB</th>
